@-moz-document url-prefix("https://www.mos.ru") {
/******************************************/
/*************              ***************/
/**********       Header       ************/
/*************              ***************/
/******************************************/
 
:root {
    --dt-black:  #202020;
    --dt-white:  #fbfdd8;
    --d-black:   #1d1d1d;
    --l-black:   #232323;

    --dt-purple: #7F7AEB;
    --d-purple:  #524CBD;
    --dt-red:    #ff6555;
    --dt-lime:   #00FF5D;
    --dt-orange: #FF7F3F;
}

/*тёмно серый*/
.popup-content, .mos_footer *, .mos_layouts_wrapper * 
{
    background: var(--d-black);
    background-color: var(--d-black);
    color: var(--dt-white);
}

/*Ссылки*/
.link_primary__fU-Jd, .link_primary__fU-Jd:active, .link_primary__fU-Jd:hover, .link_primary__fU-Jd:link, .link_primary__fU-Jd:visited, button.link_primary__fU-Jd 
{
    color: var(--dt-purple);
}

/*Выбранные ссылки*/
.Menu_text__3DGkY, a.Menu_text__3DGkY
{
    color: var(--dt-orange) !important;
}

/*Дополнительное*/
.popup-content {background: var(--d-black) !important;}
/*Убрать новости*/
.News_news__mxBN6 { display: none; }
/*Никаких border!*/
.Menu_menu__13xOb:after {display: none;}
}

@-moz-document url-prefix("https://www.mos.ru/services/catalog") {
/******************************************/
/*************              ***************/
/**********       Услуги       ************/
/*************              ***************/
/******************************************/

:root {
    --dt-black:  #202020;
    --dt-white:  #fbfdd8;
    --d-black:   #1d1d1d;
    --l-black:   #232323;

    --dt-purple: #7F7AEB;
    --d-purple:  #524CBD;
    --dt-red:    #ff6555;
    --dt-lime:   #00FF5D;
    --dt-orange: #FF7F3F;
}

/* Цвет заднего фона */
body, .catalog-main, .catalog-main__row, .catalog-categories, .service-mobile, .services-together, .b-content, .catalog-popular__item .item
{
    background: var(--dt-black);
    background-color: var(--dt-black);
    color: var(--dt-white);
}

/********************************************************/
/**********       Навигационная панель       ************/
/********************************************************/


.catalog-categories__category:hover {background: var(--l-black); color: var(--dt-orange);}


/* Ссылки */
.catalog-categories__category, .catalog-categories_category-selected .catalog-categories__category
{
    color: var(--dt-purple);
}

/* Выбранные ссылки */
.catalog-categories__category_current, .catalog-categories__category_current:hover, .catalog-categories_category-selected .catalog-categories__category.catalog-categories__category_current, .catalog-categories_category-selected .catalog-categories__category.catalog-categories__category_current:hover
{
    color: var(--dt-orange) !important;
    background: var(--l-black);
}
/* "Звёздочка" */
.catalog-categories__category_current .catalog-categories__icon_star, .catalog-categories_contrast .catalog-categories__category_current .catalog-categories__icon_star, .catalog-categories__icon_star
{
    background-image: none;
    background: var(--dt-orange);
}

/*Никаких border!*/
*, :after, :before {border: none !important;}


/********************************************************/
/**********            Выбор услуг           ************/
/********************************************************/


.catalog-popular__item .item
{
    color: var(--dt-orange);
}
}
